import React from 'react';
import styles from '../../styles/layout/NavbarBtn.module.scss';

const NavbarBtn = (props) => {
    return (
        <button className={styles.NavbarBtn}><FontAwesomeIcon icon="coffee" /></button>
    );
}

export default NavbarBtn;
